import React from 'react'



const Button = (props) => {
   const defaultStyles = {
      cursor: 'pointer',
      outline: 'none',
      height: '2rem',
      width: '6rem',
      color: 'white'
   }

   let backgroundColor = ''

   switch(props.type) {
      case 'primary':
         backgroundColor = '#3e8baa'
         break

      default:
         backgroundColor = 'darkgray'
         break
   }


   return <button 
      style={{
         ...defaultStyles,
         backgroundColor: backgroundColor
      }}
   >{props.children}</button>
}

export default Button
